public class InnerDataSourceWebCrawlerUrlsFactory(Action<Humidifier.Kendra.DataSourceTypes.WebCrawlerUrls> factoryAction = null) : SubResourceFactory<Humidifier.Kendra.DataSourceTypes.WebCrawlerUrls>
{

    internal InnerDataSourceWebCrawlerSiteMapsConfigurationFactory SiteMapsConfigurationFactory { get; set; }

    internal InnerDataSourceWebCrawlerSeedUrlConfigurationFactory SeedUrlConfigurationFactory { get; set; }

    protected override Humidifier.Kendra.DataSourceTypes.WebCrawlerUrls Create()
    {
        var webCrawlerUrlsResult = CreateWebCrawlerUrls();
        factoryAction?.Invoke(webCrawlerUrlsResult);

        return webCrawlerUrlsResult;
    }

    private Humidifier.Kendra.DataSourceTypes.WebCrawlerUrls CreateWebCrawlerUrls()
    {
        var webCrawlerUrlsResult = new Humidifier.Kendra.DataSourceTypes.WebCrawlerUrls();

        return webCrawlerUrlsResult;
    }
    public override void CreateChildren(Humidifier.Kendra.DataSourceTypes.WebCrawlerUrls result)
    {
        base.CreateChildren(result);

        result.SiteMapsConfiguration ??= SiteMapsConfigurationFactory?.Build();
        result.SeedUrlConfiguration ??= SeedUrlConfigurationFactory?.Build();
    }

} // End Of Class

